import './App.css';
import { BrowserRouter, Switch } from 'react-router-dom'
import { Route } from 'react-router-dom';
import Can from './Can'
import Home from './Components/Home';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path='/' exact component={Home}></Route>

      </Switch>
    </BrowserRouter>
  );
}

export default App;
